INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/7/0/d/200_70ae11b59ebafff956e1ce9a3a601e3d.jpg', '步骤1\n先将买来的荔浦芋头和紫薯进行简单的处理，洗净，去皮，切块，一起送入搅拌机，霍霍均匀！', 1);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/f/e/c/200_fe49a948d3dab2702dbae300a598857c.jpg', '步骤2\n你也可以用紫薯粉代替紫薯，这样做出来的颜色好看，在搅拌机里加入纯牛奶和白糖还有奶油，一起搅拌均匀，拿出后，进行数次过筛，必须无颗粒状，必须细腻顺滑！', 2);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/a/4/e/200_a4823c714a343818b9e7d282f721558e.jpg', '步骤3\n随后放入酵母，温度在35度时放酵母，搅拌均匀，不要太用力，在放入木薯淀粉，面粉，玉米油等，搅拌均匀，放入温暖的地方发酵两倍大，就可以做成你想要的形状上锅去蒸了！也可以用模具！', 3);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/a/9/4/200_a90db072b9761eca0c3b44728a3161e4.jpg', '步骤4\n锅里的水烧开才可以放，蒸35分钟后，关火，闷一会，就可以取出切块食用了！', 4);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/0/6/3/200_06193f138c0a36cac0a5deeaf490d213.jpg', '步骤1\n准备好需要的食材。', 5);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/0/1/1/200_0109f5c6756dc1a211ecb00cf95dac91.jpg', '步骤2\n鲜香菇去梗后洗净，炒锅中加入适量清水煮沸后，倒入一小勺盐，再放入香菇，中火煮3分钟。', 6);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/0/b/9/200_0b87daf0737a130e67b972111609cf19.jpg', '步骤3\n煮好的香菇在清水中拔凉，然后用手攥干水分，这里要尽量挤干水分。', 7);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/5/1/b/200_51ac4d1d7ed1e77d63f41c8715673ddb.jpg', '步骤4\n用厨房剪刀把香菇剪成长度差不多的香菇条，平铺在案板上，再次沥干水分。这里如果想省时，就放入厨房用纸中吸一下水分也可以。', 8);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/9/0/b/200_90de6690579d0087665d17dc9f92e5ab.jpg', '步骤5\n利用这个时间，正好做出一碗调味汁：4大勺的番茄酱，一勺糖、少许盐，一勺蚝油和少许醋，再加入适量清水，搅拌均匀备用。', 9);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/7/3/0/200_7346c38fdf27f876dd14d1cbcba04e50.jpg', '步骤6\n将玉米淀粉和面粉以2:1的比例混合，放入香菇条，充分包裹香菇条。', 10);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/0/c/f/200_0c0194ee2bb9cc176a6b5bd21b16b57f.jpg', '步骤7\n炒锅内放入适量食用油，烧到六成热后放入香菇条，用筷子迅速滑散。', 11);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/5/4/c/200_54b6a175901923750580c9b073503ebc.jpg', '步骤8\n保持中火煎炸4-5分钟，捞出后放在厨房用纸上吸一下油。', 12);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/8/9/2/200_890f096b3e2346a142c8f4546f830632.jpg', '步骤9\n2瓣蒜切蒜末后备用，另找一个干净炒锅，不用放油，直接放入调味汁，倒入蒜末，快速炒匀。', 13);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/e/f/2/200_efb1f5c12b18d4171f9b080064fbb942.jpg', '步骤10\n汤汁稍微粘稠就倒入香菇条，这一步翻炒要迅速，茄汁均匀包裹香菇条就关火。', 14);
INSERT INTO `douguo_step` VALUES ('https://cp1.douguo.com/upload/caiku/e/1/4/200_e1b972e481bb4ea2b32448c634222464.jpg', '步骤11\n调味汁里加点蒜末，让汤汁更香更爽口。这道菜肴趁热吃，口感外酥里嫩，特别好吃。', 15);
