INSERT INTO `note` VALUES (150, '分明是很**的红公馆，装进的却是时下最新一季的奢品，复古与风潮的碰撞，在这里张扬着各自的个性，那些主人从世界各地收罗来的茶具酒器，高定的沙发餐椅，仿佛每一件都自成一派，却和谐共处在同一个空间。本该是极其私密的伊甸园，好客的主人却让它成了她和她朋友们的聚集地，更是拜在了侯师傅的门下，携手王勇师傅做起了红公馆豪华版的新淮扬，还特地请了著名的女侍酒师美玉，为餐席搭配好酒。葱香浓郁的水菱角，醉意清浅的甜虾', 'https://www.douguo.com/dish/29445086', 'https://cp1.douguo.com/upload/note/c/4/5/320_c4be1d862f7a16919c2c95751740d215.jpeg', '繁星满天飞扬', 'https://tx1.douguo.com/upload/photo/5/9/4/70_u82968194515849172536.jpeg', 'https://www.douguo.com/u/u82968194515849', '179', '', '0', '0');
