INSERT INTO `note` VALUES (1456, '这是我有史以来觉得做菜太难了，光为买个食材就跑了好几个超市和菜市场都没买到，说不是时候，谁也不敢进，两天就坏，最后去了当地的蔬果食油大批发市场才买到，其实就是个鹌鹑蛋，现在的天气虽然很难买到，价格倒还真不贵，还和以前一样7块钱，正好家里有瓶太太乐特级红烧酱油，用来卤个红烧鹌鹑蛋再好不过了，上色漂亮，味道酱香浓郁，很对胃口噢！所需食材：鹌鹑蛋500克，太太乐特级红烧酱油1勺，小葱1棵，八角2个，花椒', 'https://www.douguo.com/dish/29441687', 'https://cp1.douguo.com/upload/note/d/3/d/320_d364e76b32401044239da2de6c2afd9d.jpeg', 'King麻麻', 'https://tx1.douguo.com/upload/photo/0/5/4/70_u29252890320701142012.jpeg', 'https://www.douguo.com/u/u29252890320701', '241', 'https://i1.douguo.com/upload/note/d/a/a/da84247847aebe48d9dd0fcdac88862a.png', '0', '0');
INSERT INTO `note` VALUES (1457, '我看见茄子的叶子绿油油的，茄子的花朵小小的，白白的，有一些花已经变成了圆圆的，淡紫色的茄子，真可爱啊！还有一些茄子，刚刚长出来，所以颜色还是白白的，快要变成紫色', 'https://www.douguo.com/dish/29442043', 'https://cp1.douguo.com/upload/note/1/0/e/320_100b7f59b1640154b883cdf3d2ae1d9e.jpg', '国少的日食记', 'https://tx1.douguo.com/upload/photo/a/8/a/70_u40289504114771181145.jpeg', 'https://www.douguo.com/u/u40289504114771', '162', '', '0', '0');
