INSERT INTO `note` VALUES (1461, '豆腐切小块儿（容易进滋味儿），锅里下油，放入葱姜沫儿爆香，放豆腐，快速煸炒一下，放入调料汁儿（蒜片儿，生抽，料酒，耗油，水适量）小火儿炖5分钟，淋入淀粉水加盐，大火收汁儿。我家一直这样做', 'https://www.douguo.com/dish/29442031', 'https://cp1.douguo.com/upload/note/a/d/5/320_adda35bd8e0512b658e8a0951e63ed65.jpg', '彬彬331', 'https://tx1.douguo.com/upload/photo/0/d/1/70_0d09a5b5c3d2b5f22349b41906c39271.jpg', 'https://www.douguo.com/u/u87497277704063', '158', '', '0', '0');
